        height: 40px;

      }

        content: '';

        height: 20%;

        position: absolute;
        bottom: 0%;
        left: 0;
        border-radius: 50%;
        animation: rotate-square-2-shadow .5s linear infinite;
      }
      .spinner:after {
        content: '';
        width: 100%;
        height: 100%;
        background: #3963bc;
        animation: rotate-square-2-animate .5s linear infinite;
        position: absolute;
        bottom:40%;
        left: 0;
        border-radius: 3px;
      }

		17% {

		25% {

		}
		50% {

		}
		75% {
			transform: translateY(20%) rotate(67.5deg);
		}
		100% {
			transform: translateY(0) rotate(90deg);
		}
    }

		}
